import React from 'react'

class QuarantineInfo extends React.Component {
    constructor (props) {
      super(props)

      this.state = {
        recipedata: ''
      }
    }

    componentDidMount () {
      var recipe = this.props.location.state

      this.setState({
        recipedata: recipe.test
      })
    }

      render = () => {
        var ingredients = this.state.recipedata.ingredientLines
        //  console.log('ingredients', typeof (ingredients))

        return (
          <CurrentRecipe
            full = {this.state.recipedata}
            title = {this.state.recipedata.label}
            serving = {this.state.recipedata.yield}
            dietlabels = {this.state.recipedata.dietLabels}
            ingredients = {ingredients}
            instructions = {this.state.recipedata.url}
            image = {this.state.recipedata.image}
          />
        )
      }
  }

  export default QuarantineInfo
